import React from "react";
import Select from 'react-select';
import 'bootstrap/dist/css/bootstrap.css';
import Avatar from '@material-ui/core/Avatar';
import Button from '@material-ui/core/Button';
import CssBaseline from '@material-ui/core/CssBaseline';
import Link from '@material-ui/core/Link';
import Box from '@material-ui/core/Box';
import Typography from '@material-ui/core/Typography';
import { makeStyles } from '@material-ui/core/styles';
import Container from '@material-ui/core/Container';
import { useHistory } from "react-router-dom";

const options = [
  { value: 'Automation', label: 'Automation' },
  { value: 'Performance', label: 'Performance' },
  { value: 'Functional', label: 'Functional' },
  { value: 'Security', label: 'Security' },
];

const experience = [
  { value: '1-3 years', label: '1-3 Years' },
  { value: '3-7 Years', label: '3-7 Years' },
  { value: '10+ Years', label: '10+ Years' },
  { value: '15+ Years', label: '15+ Years' },
];

const Resources = [
  { value: 'Shanavas', label: 'Shanavas' },

];

const useStyles = makeStyles((theme) => ({
  paper: {
    marginTop: theme.spacing(8),
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  },
  avatar: {
    margin: theme.spacing(1),
    backgroundColor: theme.palette.secondary.main,
  },
  form: {
    width: '100%', // Fix IE 11 issue.
    marginTop: theme.spacing(1),
  },
  submit: {
    margin: theme.spacing(3, 0, 2),
  },
}));
function Copyright() {
  return (
    <Typography variant="body2" color="textSecondary" align="center">
      {'Copyright © '}
      <Link color="inherit" href="https://www.planittesting.com/au/home">
        Planit Testing
        </Link>{' '}
      {new Date().getFullYear()}
      {'.'}
    </Typography>
  );
}


export default function Homepage() {
  const classes = useStyles();
  const history = useHistory();
  const getResume = () => history.push('resume');
  return (

      <section id="p_lt_ctl03_pageplaceholder_p_lt_ctl02_Courses1_course" class="home_course ease listings-column4" style="background-image: url('https://cdn.planittesting.com/planit/media/siteimages/backgrounds/training-bg.jpg?ext=.jpg');">
        <div class="auto-wrapper">
          <div data-animation="fadeInUp" data-delay="0" class="intro home_course-tag-line animated fadeInUp visible">
            <h2 id="p_lt_ctl03_pageplaceholder_p_lt_ctl02_Courses1_title" style="color:#FFFFFF;" tabindex="0">Your Partner for Digital Quality</h2>
            <p tabindex="0">No matter your budget or requirement, if you're seeking quality and efficiency, we can help. We can provide advice, capability, tools or training.</p>

          </div>
          <ul id="p_lt_ctl03_pageplaceholder_p_lt_ctl02_Courses1_ulCourseList" class="home_course-list ease lists-column4">

            <li>
              <div data-animation="fadeInUp" data-delay="200" class="home_course-wrap animated fadeInUp visible">

                <div class="home_course-icon-holder" aria-hidden="true"><span class="pi pi pi-Test-Strategy "></span></div>
                <div class="home_course-text-wrap js_home_course-text-wrap" style="height: 148px;">
                  <h3 style="color:#FFFFFF" tabindex="0">Consultancy</h3>
                  <p tabindex="0">Put your project or department on the right path to accelerated delivery and quality outcomes.</p>

                </div>

              </div>
            </li>

            <li>
              <div data-animation="fadeInUp" data-delay="200" class="home_course-wrap animated fadeInUp visible">

                <div class="home_course-icon-holder" aria-hidden="true"><span class="pi pi pi-On-Site-Testing "></span></div>
                <div class="home_course-text-wrap js_home_course-text-wrap" style="height: 148px;">
                  <h3 style="color:#FFFFFF" tabindex="0">Services</h3>
                  <p tabindex="0">Deliver upon your project’s requirements with our 1,000+ team of highly skilled testing specialists.</p>

                </div>

              </div>
            </li>

            <li>
              <div data-animation="fadeInUp" data-delay="200" class="home_course-wrap animated fadeInUp visible">

                <div class="home_course-icon-holder" aria-hidden="true"><span class="pi pi pi-Testing-Training "></span></div>
                <div class="home_course-text-wrap js_home_course-text-wrap" style="height: 148px;">
                  <h3 style="color:#FFFFFF" tabindex="0">Training</h3>
                  <p tabindex="0">Ensure your internal capability meets project requirements by upskilling your team where it counts.</p>

                </div>

              </div>
            </li>

            <li>
              <div data-animation="fadeInUp" data-delay="200" class="home_course-wrap animated fadeInUp visible">

                <div class="home_course-icon-holder" aria-hidden="true"><span class="pi pi pi-Efficiency "></span></div>
                <div class="home_course-text-wrap js_home_course-text-wrap" style="height: 148px;">
                  <h3 style="color:#FFFFFF" tabindex="0">Solutions</h3>
                  <p tabindex="0">Discover solutions that can enhance project visibility and efficiency, saving you time and money.</p>

                </div>

              </div>
            </li>

          </ul>
          <a href="Contact" id="p_lt_ctl03_pageplaceholder_p_lt_ctl02_Courses1_lnkAll" data-animation="fadeInUp" data-delay="0" class="btn btn-inlineblock btn-blue home_course_view animated fadeInUp visible" tabindex="0">How can we help you?</a>
        </div>
      </section>

  );


}
